Hi @lucamassaron  --  there really are only 286 possible 10-mer histograms. No selection needed.  
Each 10-mer has exactly 10 bases (A, T, C, G).  Position does not matter for the histogram count. 
Here's a snippet that calculates the number of possibilities:
count = 0
for i in range(11):
    for j in range(11-i):
        for k in range(11-j):
            for l in range(11-k):
                if 10 == i + j + k + l:
                    count += 1

print(count)

[EDIT] I can no longer count, but apparently others can. From the paper, the closed form calculation is 
(k + 3)!/(k!3!)

